import React from 'react'
import { Header } from './headerStyle'

class header extends React.Component {
    constructor() {
        super()
        this.state = {}
    }

    render() {
        return (
            <Header>
                <button>
                    <li className="material-icons">
                        arrow_back</li>
                </button>
            </Header>
        )
    }
}

export default header
